@import "./variables.scss";

.home-title {
     position: absolute;
     top: 0;
     left: 0;
     right: 0;
     height: calc(100vh - #{$navbar-height});
     display: flex;align-items: center;
     justify-content: center;
     flex-direction: column;
     color: $clr-text-primary;

     svg {
          max-width: 100%;
          fill: transparent;

          @media all and (-ms-high-contrast: none),
          (-ms-high-contrast: active) {
               fill: currentColor;
          }
     }

     div:nth-child(1) {
          width: 100%;
          padding: 0 33vw 0 17vw;
          margin-bottom: 5vh;

          @for $i from 1 through 14 {
               path:nth-child(#{$i}) {
                    stroke-dasharray: 400;
                    stroke-dashoffset: 400;
                    animation: strokein 3000ms #{$i * 200ms} forwards,
                    fillin 5000ms #{$i * 200ms + 2000ms} forwards;
               }
          }
     }

     div:nth-child(2) {
          width: 100%;
          padding: 0 22vw 5vh 48vw;
          margin-top: 5vh;

          @for $i from 1 through 12 {
               path:nth-child(#{$i}) {
                    stroke-dasharray: 300;
                    stroke-dashoffset: 300;
                    animation: strokein 3000ms #{$i * 200ms + 1500ms},
                    fillin 5000ms #{$i * 120ms + 3200ms} forwards;
               }
          }
     }

     @keyframes strokein {
          70% {
               stroke-dashoffset: 0;
               stroke: $clr-text-primary;
          }

          100% {
               stroke-dashoffset: 0;
               stroke: transparent;
          }
     }

     @keyframes fillin {
          from {
               fill: transparent;
          }

          to {
               fill: $clr-text-primary;
          }
     }
}
